import React, {Component} from 'react';

import {
    Link
}from 'react-router-dom';

function Header() {
    return (
        <header>
            <div className="logo">
                LOGO
            </div>

            <nav>
                <ul>
                    <li className="first">
                        <a href="#">Home</a>
                    </li>
                    <li>
                        <Link to="/Products">Products</Link>
                        <a href="/Product">Products</a>
                    </li>
                    <li className="last">
                        <a href="#">Contact</a>
                    </li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
